import React from "react";

function MarketValue({market_value, investedAmmount, unrealized_p_and_l, percentage_of_portfolio_value}) {
  return (
    <div className="market_value">
      <div className="values">
        <div>
          <p className="label">Market value </p>
          <p>$</p>
        </div>

        <div>
          <p className="label">% of portfolio value</p>
          <p>40%</p>
        </div>
      </div>
      <div className="progress_bar_wrapper">
          <div className="progress_bar profit" style={{"width": "22.30%"}}></div>
        </div>
    </div>
  );
}

export default MarketValue;
